@ethanprestwood_64 i never said we deserve all the recognition in the world and straights don’t. straights are recognized every day of the year, whereas lgbt people aren’t. that’s why we have pride month: so lgbt folks can come together and be prideful about their sexualities and gender identities, especially if they’re forced to be closeted and/or are having trouble accepting themselves. pride month isn’t about shoving sexuality down other people’s throats. some people may do that, yes, but it’s not what pride month is for. 
maybe statistics show that a higher percentage of straight people are killed vs gay people, but you can’t look at the over all percentage. straights aren’t killed/beaten up/etc. because they’re straight. when lgbt people are, on the other hand, the majority of the time it’s because of their identity. it’s like when you look back into the 50s/60s — if a white person was killed, it was unlikely that it was because they were white. however, it a black person was killed, you bet your ass it was because they were black. the same goes for bullying. 
as far as how often these things happen, it’s more often then you might think. buzzfeed just put out an article of a bunch of headlines from 2019 showing violent acts toward lgbt folk. at this point, i, as well as many other people, i’m sure, am too afraid to be in public alone for fear of being hurt because of who i am — and most of the time, you’d have to really be looking to know i’m lgbt. just because things haven’t been happening to you or around you doesn’t mean they’re not happening to others in other parts of the world, or even just the country.
